    return (
      <Fragment>
        {/* <Navbar /> */}
        <form action="">
          <div>
            <label htmlFor="email"></label>
            <input type="email" id="email" autoComplete="off">Email</input>
          </div>
          <div>
            <label htmlFor="password"></label>
            <input type="passwrod" id="password" autoComplete="off">Password</input>
          </div>

          <button type="submit">Login</button>
        </form>
      </Fragment>
    );
  }
}

export default LoginPage;
